import styled from 'styled-components';
function Homepage() {
  return (
   <StyledWrapper>
    <div id='a'>a</div>
    <div id='b'>b</div>
    <div id='c'>c</div>
    <div id='d'></div>
    <div id='e'></div>
    <div id='f'></div>
    <div id='g'></div>
    <div id='h'></div>

    </StyledWrapper>
  );
}

const StyledWrapper = styled.div`
 height:100vh;
 display:grid;
 grid-template-columns: repeat(6) ;
 grid-template-rows: repeat(3, 150px) ;
 grid-gap: 20px 20px;

 background: var(--mainbg);
 background-size: var(--mainbg-size);

 div{
  background-color:white;
 }
  #a{
    grid-column-start:1;
    grid-column-end: 7;
  }
    #b{
      grid-column-start:1;
      grid-column-end: 7;
    }

`;

export default Homepage;
